; &lt;br /&gt;\n2018-07-02 00:00:00  1.16841  1.16894  1.16601  1.16653       0\n2018-07-02 01:00:00  1.16656  1.16748  1.16622  1.16737       0\n2018-07-02 02:00:00  1.16737  1.16824  1.16706  1.16781       0\n2018-07-02 03:00:00  1.16781  1.16789  1.16640  1.16646       0\n2018-07-02 04:00:00  1.16646  1.16689  1.16540  1.16591       0\n...                      ...      ...      ...      ...     ...\n2018-12-31 18:00:00  1.14334  1.14592  1.14266  1.14541       0\n2018-12-31 19:00:00  1.14542  1.14562  1.14442  1.14511       0\n2018-12-31 20:00:00  1.14511  1.14547  1.14418  1.14449       0\n2018-12-31 21:00:00  1.14449  1.14558  1.14442  1.14530       0\n2018-12-31 22:00:00  1.14530  1.14608  1.14530  1.14558       0&lt;/p&gt;\n\n&lt;p&gt;[3109 rows x 5 columns]&lt;/p&gt;\n\n&lt;table class=\"metaDataTable\"&gt;\n&lt;thead&gt;\n&lt;tr&gt;\n  &lt;th&gt;Parameter&lt;/th&gt;\n  &lt;th&gt;Value&lt;/th&gt;\n&lt;/tr&gt;\n&lt;/thead&gt;\n&lt;tbody&gt;\n&lt;tr&gt;\n  &lt;td&gt;period&lt;/td&gt;\n  &lt;td&gt;14&lt;/td&gt;\n&lt;/tr&gt;\n&lt;/tbody&gt;\n&lt;/table&gt;\n\n&lt;p&gt;Source Code:&lt;/p&gt;\n\n&lt;pre&gt;&lt;code&gt;class MyStrategy(bt.Strategy):\n    params = (('path_model', 'bestRF_SQN_ahead_8_m_16.joblib'),\n              ('m', 16),\n              ('stoptype', bt.Order.StopTrail),\n              ('trailpercent',0.000))  # price is 2% less than the entry point\n\n    def __init__(self):          \n        self.lines.rf = MyRFIndicator(self.data, path_model=self.p.path_model, m=self.p.m)\n        '''\n        Nuvos indicadores\n        -Una EMA de 8 periodos y una de 14 periodos (https://www.backtrader.com/blog/posts/2018-01-27-recursive-indicators/recursive-indicator/)\n        -Un RSI de 7 periodos con nivel de sobrecopra de 70 y de sobreventa de 30.\n        '''\n        self.lines.rsi = RSI(self.data, period=7)\n        self.lines.ema = EMA(self.data, period=8)\n        self.lines.ema = EMA(self.data, period=14)\n#         self.lines.ema = bt.ind.EMA(self.data, period=8)\n#         self.lines.ema = bt.ind.EMA(self.data, period=14)\n#         bt.ind.RSI(self.data, period=7)\n        self.ahead_time = 8\n        self.timeIni = None \n#         self.order = None\n\n    def notify_order(self, order):\n        ''' \u00bfPor qu\u00e9 usar notify_order?\n        Porque esto asegura que la orden que debe ser controlada por el Stop realmente se ha ejecutado. Esto puede no ser un gran problema \n        durante las pruebas de backtesting, pero lo es cuando se opera en vivo.   \n        ''' \n        if not order.status == order.Completed:\n            return  # discard any other notification\n\n        if not self.position:  # we left the market\n            print('SELL@price: {:.2f}'.format(order.executed.price))\n            return\n\n        # We have entered the market\n        print('BUY @price: {:.2f}'.format(order.executed.price))\n\n\n\n    def next(self):       \n        if not self.position:  # not in the market\n            self.timeIni = len(self.data)\n\n            if self.lines.rf[0] == 1:                 \n                size = int(self.broker.get_cash() / self.data)\n                self.buy(size=size)\n                # Stop trail       \n#                 self.buy(size=size, exectype=self.p.stoptype, trailpercent=self.p.trailpercent)\n#                 self.sell(size=size, exectype=self.p.stoptype, trailpercent=self.p.trailpercent)\n\n            # print('COMPRO!')                \n            elif self.lines.rf[0] == 0:\n                size = int(self.broker.get_cash() / self.data)\n                self.sell(size=size)\n#                 self.sell(size=size, exectype=self.p.stoptype, trailpercent=self.p.trailpercent)\n                # Stop trail       \n#                 self.buy(size=size, exectype=self.p.stoptype, trailpercent=self.p.trailpercent)\n\n#                 print('VENDO!')                        \n        elif self.position:  # in the market\n            if len(self.data) &amp;gt; self.timeIni + self.ahead_time:\n                self.close()  # close long position\n\n&lt;/code&gt;&lt;/pre&gt;\n\n&lt;hr /&gt;\n\n&lt;h1&gt;Data Feeds&lt;/h1&gt;\n\n&lt;h2&gt;PandasData&lt;/h2&gt;\n\n&lt;table class=\"metaDataTable\"&gt;\n&lt;thead&gt;\n&lt;tr&gt;\n  &lt;th&gt;Property&lt;/th&gt;\n  &lt;th&gt;Value&lt;/th&gt;\n&lt;/tr&gt;\n&lt;/thead&gt;\n&lt;tbody&gt;\n&lt;tr&gt;\n  &lt;td&gt;DataName:&lt;/td&gt;\n  &lt;td&gt;Open     High      Low    Close  Volume&lt;/td&gt;\n&lt;/tr&gt;\n&lt;/tbody&gt;\n&lt;/table&gt;\n\n&lt;p&gt;&lt;DATE&gt;_&lt;TIME&gt; &lt;br /&gt;\n2018-07-02 00:00:00  1.16841  1.16894  1.16601  1.16653       0\n2018-07-02 01:00:00  1.16656  1.16748  1.16622  1.16737       0\n2018-07-02 02:00:00  1.16737  1.16824  1.16706  1.16781       0\n2018-07-02 03:00:00  1.16781  1.16789  1.16640  1.16646       0\n2018-07-02 04:00:00  1.16646  1.16689  1.16540  1.16591       0\n...                      ...      ...      ...      ...     ...\n2018-12-31 18:00:00  1.14334  1.14592  1.14266  1.14541       0\n2018-12-31 19:00:00  1.14542  1.14562  1.14442  1.14511       0\n2018-12-31 20:00:00  1.14511  1.14547  1.14418  1.14449       0\n2018-12-31 21:00:00  1.14449  1.14558  1.14442  1.14530       0\n2018-12-31 22:00:00  1.14530  1.14608  1.14530  1.14558       0&lt;/p&gt;\n\n&lt;p&gt;[3109 rows x 5 columns]|\n|Timezone:|None|\n|Number of bars:|3109|\n|Bar Length:|1 Day|&lt;/p&gt;\n\n&lt;hr /&gt;\n\n&lt;h1&gt;Observers&lt;/h1&gt;\n\n&lt;h2&gt;Broker&lt;/h2&gt;\n\n&lt;table class=\"metaDataTable\"&gt;\n&lt;thead&gt;\n&lt;tr&gt;\n  &lt;th&gt;Parameter&lt;/th&gt;\n  &lt;th&gt;Value&lt;/th&gt;\n&lt;/tr&gt;\n&lt;/thead&gt;\n&lt;tbody&gt;\n&lt;tr&gt;\n  &lt;td&gt;fund&lt;/td&gt;\n  &lt;td&gt;None&lt;/td&gt;\n&lt;/tr&gt;\n&lt;/tbody&gt;\n&lt;/table&gt;\n\n&lt;h2&gt;Trades&lt;/h2&gt;\n\n&lt;table class=\"metaDataTable\"&gt;\n&lt;thead&gt;\n&lt;tr&gt;\n  &lt;th&gt;Parameter&lt;/th&gt;\n  &lt;th&gt;Value&lt;/th&gt;\n&lt;/tr&gt;\n&lt;/thead&gt;\n&lt;tbody&gt;\n&lt;tr&gt;\n  &
